import { Box, Typography } from "@mui/material";
import MyButton from "./MyButton";
import { useNavigate } from "react-router-dom";
import BaseBox from "./BaseBox";
import DoubleBox from "./DoubleBox";

const OrderListSecond = ({ setPageNumber }) => {
  const navigate = useNavigate();
  const props1 = {
    sx: {
      mx: "50px",
      my: "30px",
      py: "15px",
      px: "30px",
      width: "700px",
    },
  };

  return (
    <BaseBox>
      <Box mt={5} width="900px">
        <Typography variant="h5" fontWeight="700">
          1. 운송타입 선택
        </Typography>
        <DoubleBox props1={props1}>테스트</DoubleBox>
        <Typography variant="h5" fontWeight="700">
          2. 화물정보 입력
        </Typography>
        <Box
          sx={{
            mx: "50px",
            my: "30px",
            py: "15px",
            px: "30px",
            bgcolor: "#b6b6b6ff",
            width: "700px",
          }}
        >
          <Box
            sx={{
              bgcolor: "white",
            }}
          >
            {" "}
            테스트
          </Box>
        </Box>
        <Typography variant="h5" fontWeight="700">
          3. 배송옵션 입력
        </Typography>
        <Box
          sx={{
            mx: "50px",
            my: "30px",
            bgcolor: "#b6b6b6ff",
            width: "700px",
            height: "500px",
          }}
        ></Box>
      </Box>
      <Box width="300px" my={5} display="flex" justifyContent="space-between">
        <MyButton
          type="negative"
          value="뒤로 가기"
          onClick={() => {
            setPageNumber(1);
          }}
          sx={{ width: "100px", height: "50px" }}
        />
        <MyButton
          value="결과 조회"
          onClick={() => {
            navigate("/OrderResult");
          }}
          sx={{ width: "100px", height: "50px" }}
        />
      </Box>
    </BaseBox>
  );
};

export default OrderListSecond;
